"""
    dnnl_format_tag_t

Memory format tag specification.

oneDNN formats describe physical data layout. The physical layout is described as a sequence of the dimensions as they are laid out in the memory (from the outer-most to the inner-most). Note that this order doesn't affect the logical order of the dimensions that is kept in the `dims` field of the [`dnnl_memory_desc_t`](@ref) structure. The logical order of the dimensions is specified by the primitive that uses the tensor.

For example, CNN 5D tensor always has its logical dimensions in the order `(batch, channels, depth, height, width)`, while the physical layout might be `NCDHW` (corresponds to #dnnl\\_ncdhw format tag) or `NDHWC` (corresponds to #dnnl\\_ndhwc format tag).

~~~cpp int batch = 2, channels = 16, depth = 13, height = 13, width = 13;

int ndims = 5; // 5D tensor [`dnnl_dims_t`](@ref) dims = {batch, channels, depth, height, width}; [`dnnl_memory_desc_t`](@ref) data\\_in\\_ncdhw; [`dnnl_memory_desc_create_with_tag`](@ref)( &data\\_in\\_ncdhw, 5, dims, dnnl\\_f32, dnnl\\_ncdhw);

// note that in both cases dims passed are the same [`dnnl_memory_desc_t`](@ref) data\\_in\\_ndhwc; [`dnnl_memory_desc_create_with_tag`](@ref)( &data\\_in\\_ndhwc, 5, dims, dnnl\\_f32, dnnl\\_ndhwc);

[`dnnl_memory_desc_destroy`](@ref)(data\\_in\\_ncdhw); [`dnnl_memory_desc_destroy`](@ref)(data\\_in\\_ndhwc); ~~~

Memory format tags can be further divided into two categories: - Domain-agnostic names, i.e. names the do not depend on the tensor usage in the specific primitive. These names use letters from `a` to `l` to denote logical dimension from 1 to 12, and form the order in which the dimensions are laid in memory. For instance, #dnnl\\_ab is used to denote 2D tensor where the second logical dimension (aka `b`) is the innermost, i.e. has stride = 1, and the first logical dimension (`a`) laid out in memory with stride equal to the size of second dimension. On the other hand, #dnnl\\_ba is just transposed version of the same tensor: the first dimension (`a`) becomes the innermost one. - Domain-specific names, i.e. names that make sense only in the context of a certain domain, such as CNN. This names are just aliases to the corresponding domain-agnostic tags and used mostly for the convenience. For example, #dnnl\\_nc is used to denote 2D CNN activations tensor memory format, where channels are the innermost dimension and batch is an outermost one. Moreover, #dnnl\\_nc is just an alias to #dnnl\\_ab, since for oneDNN CNN primitives the logical dimensions of activations tensors come in order: batch, channels, spatial. In other words, batch corresponds to the first logical dimension (`a`), channels correspond to the second one (`b`).

The following domain-specific notation applies to memory format tags: - `'n'` denotes the mini-batch dimension - `'c'` denotes a channels dimension - When there are multiple channel dimensions (for example, in convolution weights tensor), `'i'` and `'o'` denote dimensions of input and output channels - `'d',` `'h',` and `'w'` denote spatial depth, height, and width respectively

Upper-case letters indicate that the data is laid out in blocks for a particular dimension. In such cases, the format name contains both upper- and lower-case letters for that dimension with a lower-case letter preceded by the block size. For example: #dnnl\\_nChw8c describes a format where the outermost dimension is mini-batch, followed by the channel block number, followed by the spatial height and width, and finally followed by 8-element channel blocks.

