| dnnl\\_format\\_tag\\_undef | Undefined memory format tag                                                                                                                                                                                                                                                                            |
| dnnl\\_format\\_tag\\_any   | Undefined memory format tag. The primitive selects a format automatically.                                                                                                                                                                                                                             |
