"""
    dnnl_normalization_flags_t

Flags for normalization primitives.

| Enumerator                          | Note                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       |
| :---------------------------------- | :------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |
| dnnl\\_normalization\\_flags\\_none | Use no normalization flags  If specified - on forward training propagation mean and variance are computed and stored as output - on backward propagation compute full derivative wrt data - on backward propagation prop\\_kind == #dnnl\\_backward\\_data has the same behavior as prop\\_kind == #dnnl\\_backward                                                                                                                                                                                                        |
| dnnl\\_use\\_global\\_stats         | Use global statistics  If specified - on forward propagation use mean and variance provided by user (input) - on backward propagation reduces the amount of computations, since mean and variance are considered as constants  If not specified: - on forward propagation mean and variance are computed and stored as output - on backward propagation compute full derivative wrt data                                                                                                                                   |
| dnnl\\_use\\_scale                  | Use scale parameter  If specified: - on forward propagation use scale for the normalization results - on backward propagation (for prop\\_kind == #dnnl\\_backward) compute diff wrt scale (hence one extra output used)                                                                                                                                                                                                                                                                                                   |
| dnnl\\_use\\_shift                  | Use shift parameter  If specified: - on forward propagation use shift (aka bias) for the normalization results - on backward propagation (for prop\\_kind == #dnnl\\_backward) compute diff wrt shift (hence one extra output used)                                                                                                                                                                                                                                                                                        |
| dnnl\\_fuse\\_norm\\_relu           | Fuse with ReLU  The flag implies negative slope being 0. On training this is the only configuration supported. For inference, to use non-zero negative slope consider using dev_guide_attributes_post_ops.  If specified: - on inference this option behaves the same as if the primitive were fused with ReLU using post ops API with zero negative slope. - on training primitive requires workspace (required to be able to perform backward pass)                                                                      |
| dnnl\\_fuse\\_norm\\_add\\_relu     | Fuse with Add and then fuse with ReLU  If specified:  - on forward propagation apply element-wise binary Add operation to to the normalization results with an additional input tensor and then apply ReLU with negative slope being 0. - on training primitive requires workspace (required to be able to perform backward pass). - on backward propagation save the result of backward ReLU operation with input tensor and workspace from forward pass to extra output tensor and then perform backward normalization.  |
"""
@cenum dnnl_normalization_flags_t::UInt32 begin
    dnnl_normalization_flags_none = 0
    dnnl_use_global_stats = 1
    dnnl_use_scale = 2
    dnnl_use_shift = 4
    dnnl_fuse_norm_relu = 8
    dnnl_fuse_norm_add_relu = 16
end

"""
    __JL_Ctag_1

` DO_NOT_DOCUMENT_THIS`

Hex representation for a **special** quiet NAN (!= NAN from math.h)
"""
struct __JL_Ctag_1
    data::NTuple{4, UInt8}
end

function Base.getproperty(x::Ptr{__JL_Ctag_1}, f::Symbol)
    f === :u && return Ptr{Cuint}(x + 0)
    f === :f && return Ptr{Cfloat}(x + 0)
    return getfield(x, f)
end

function Base.getproperty(x::__JL_Ctag_1, f::Symbol)
    r = Ref{__JL_Ctag_1}(x)
    ptr = Base.unsafe_convert(Ptr{__JL_Ctag_1}, r)
    fptr = getproperty(ptr, f)
    GC.@preserve r unsafe_load(fptr)
end

function Base.setproperty!(x::Ptr{__JL_Ctag_1}, f::Symbol, v)
    unsafe_store!(getproperty(x, f), v)
end

