"""
    dnnl_primitive_desc_query(primitive_desc, what, index, result)

Queries a primitive descriptor for various pieces of information.

The most common use case is to query a primitive descriptor, created with source, weights, and destination memory descriptors with format tags set to #dnnl\\_format\\_tag\\_any, for the corresponding memory descriptors (in this case the `what` is set to #dnnl\\_query\\_src\\_md, #dnnl\\_query\\_weights\\_md, and #dnnl\\_query\\_dst\\_md respectively) so that it is possible to create memory objects and reorder primitives if necessary.

Another typical use case is to query a primitive descriptor for workspace memory descriptor (with `what` set to #dnnl\\_query\\_workspace\\_md). If this query returns #dnnl\\_not\\_required status, then workspace memory is not required.

!!! note

    When querying for a memory descriptor for a scratchpad, a workspace, or an optional parameter, the query will return a pointer to a zero memory descriptor if the parameter is not needed.

A few other use cases: - query a primitive descriptor for the implementation information string (#dnnl\\_query\\_impl\\_info\\_str) - query a primitive descriptor for the number of inputs and outputs (#dnnl\\_query\\_num\\_of\\_inputs\\_s32 and #dnnl\\_query\\_num\\_of\\_outputs\\_s32 respectively)

# Arguments
* `primitive_desc`: Primitive descriptor.
* `what`: Parameter to query.
* `index`: Index of the parameter to query for.
* `result`: Output result. The type depends on the query. For example, it must be a [`dnnl_memory_desc_t`](@ref)* if querying for a memory descriptor.
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
# See also
[`dnnl_query_t`](@ref) for more options
"""
function dnnl_primitive_desc_query(primitive_desc, what, index, result)
    @ccall libdnnl.dnnl_primitive_desc_query(primitive_desc::const_dnnl_primitive_desc_t, what::dnnl_query_t, index::Cint, result::Ptr{Cvoid})::dnnl_status_t
end

