    dnnl_primitive_desc_query_md(primitive_desc, what, index)

Queries primitive descriptor for a memory descriptor.

!!! note

    This function is a convenience version of #[`dnnl_primitive_desc_query`](@ref)().

# Arguments
* `primitive_desc`: Primitive descriptor.
* `what`: Kind of memory descriptor parameter to query for.
* `index`: Index of the parameter to query.
# Returns
NULL in case of any error.
"""
function dnnl_primitive_desc_query_md(primitive_desc, what, index)
    @ccall libdnnl.dnnl_primitive_desc_query_md(primitive_desc::const_dnnl_primitive_desc_t, what::dnnl_query_t, index::Cint)::const_dnnl_memory_desc_t
end

