"""
    dnnl_primitive_attr_set_scales_mask(attr, arg, mask)

Sets primitive attributes scaling factors for primitive operations for a given memory argument. The scaling factors must be passed at execution time as an argument with index #[`DNNL_ARG_ATTR_SCALES`](@ref) | arg.

# Arguments
* `attr`: Primitive attributes.
* `arg`: Parameter argument index as passed to the [`dnnl_primitive_execute`](@ref)() call.
* `mask`: Scaling factors correspondence mask that defines the correspondence between the tensor dimensions and the `scales` array. The set i-th bit indicates that a dedicated scaling factor is used for each index along that dimension. Set the mask to 0 to use a common scaling factor for the whole output tensor.
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
# See also
[`dnnl_primitive_attr_set_scales_mask`](@ref)
"""
function dnnl_primitive_attr_set_scales_mask(attr, arg, mask)
    @ccall libdnnl.dnnl_primitive_attr_set_scales_mask(attr::dnnl_primitive_attr_t, arg::Cint, mask::Cint)::dnnl_status_t
end

