Appends an accumulation v3 (sum) to post-ops. Prior to accumulating the result, a zero point is subtracted from the previous value and is multiplied by the scale.

The kind of this post-op is #dnnl\\_sum.

This feature may improve performance for cases like dequantize the asymmetrically quantized sum's src1 tensor to f32 domain before performing the sum operation by subtracting the `zero_point` before the scaling.

In the simplest case where accumulation is the only post-op, the computations will be:

dst[:] <- scale * (dst[:] - zero\\_point) + op(...) // instead of dst[:] <- op(...)

If `data_type` is specified, original dst tensor will be reinterpreted as a tensor with provided data type. Since it is reinterpretation, data\\_type and dst data type should have the same size. As a result, computations will be:

dst[:] <- scale * (as\\_data\\_type(dst[:]) - zero\\_point) + op(...) // instead of dst[:] <- op(...)

!!! note

    This post-op executes in-place and does not change the destination layout.

# Arguments
* `post_ops`: Post-ops.
* `scale`: Accumulation scaling factor.
* `zero_point`: Single scalar int32\\_t value of zero point.
* `data_type`: Accumulation data\\_type.
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_post_ops_append_sum(post_ops, scale, zero_point, data_type)
    @ccall libdnnl.dnnl_post_ops_append_sum(post_ops::dnnl_post_ops_t, scale::Cfloat, zero_point::Int32, data_type::dnnl_data_type_t)::dnnl_status_t
end

