"""
    dnnl_memory_desc_reshape(out_memory_desc, in_memory_desc, ndims, dims)

Creates a memory descriptor by reshaping an existing one. The new memory descriptor inherits the data type. This operation is valid only for memory descriptors that have format\\_kind #dnnl\\_blocked or #dnnl\\_format\\_kind\\_any.

The resulting memory descriptor must be destroyed separately.

The operation ensures the transformation of the physical memory format corresponds to the transformation of the logical dimensions. If such transformation is impossible, the function returns #dnnl\\_invalid\\_arguments.

The reshape operation can be described as a combination of the following basic operations: 1. Add a dimension of size `1`. This is always possible. 2. Remove a dimension of size `1`. This is possible only if the dimension has no padding (i.e. `padded\\_dims[dim] == dims[dim] && dims[dim] == 1`). 3. Split a dimension into multiple ones. This is possible only if the size of the dimension is exactly equal to the product of the split ones and the dimension does not have padding (i.e. `padded\\_dims[dim] = dims[dim]`). 4. Joining multiple consecutive dimensions into a single one. As in the cases above, this requires that the dimensions do not have padding and that the memory format is such that in physical memory these dimensions are dense and have the same order as their logical counterparts. This also assumes that these dimensions are not blocked. - Here, dense means: `stride for dim[i] == (stride for dim[i + 1]) * dim[i + 1]`; - And same order means: `i < j` if and only if `stride for dim[j] <= stride for dim[i]`.

!!! warning

    Some combinations of physical memory layout and/or offsets or dimensions may result in a failure to make a reshape.

# Arguments
* `out_memory_desc`: Output memory descriptor.
* `in_memory_desc`: An existing memory descriptor. Must have format\\_kind set to #dnnl\\_blocked or #dnnl\\_format\\_kind\\_any.
* `ndims`: Number of dimensions for the output memory descriptor.
* `dims`: Dimensions for the output memory descriptor.
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_memory_desc_reshape(out_memory_desc, in_memory_desc, ndims, dims)
    @ccall libdnnl.dnnl_memory_desc_reshape(out_memory_desc::Ptr{dnnl_memory_desc_t}, in_memory_desc::const_dnnl_memory_desc_t, ndims::Cint, dims::Ptr{Clong})::dnnl_status_t
end

"""
    dnnl_memory_desc_permute_axes(out_memory_desc, in_memory_desc, permutation)

Creates a memory descriptor by permuting axes in an existing one.

The physical memory layout representation is adjusted accordingly to maintain the consistency between the logical and physical parts of the memory descriptor.

The resulting memory descriptor must be destroyed separately.

The new memory descriptor inherits the data type. This operation is valid only for memory descriptors that have format\\_kind set to #dnnl\\_blocked or #dnnl\\_format\\_kind\\_any.

The logical axes will be permuted in the following manner: ``` for (i: 0 .. in\\_memory\\_desc->ndims) out\\_memory\\_desc->dims[permutation[i]] = in\\_memory\\_desc->dims[i]; ```

Example:

```c++
     dnnl_memory_desc_t in_md, out_md, expect_out_md;

     const int permutation[] = {1, 0}; // swap the first and the second axes

     dnnl_dims_t in_dims = {2, 3}, out_dims = {3, 2};
     dnnl_format_tag_t in_tag = dnnl_ab, out_tag = dnnl_ba;

     dnnl_memory_desc_create_with_tag(
             &in_md, 2, in_dims, data_type, in_tag);
     dnnl_memory_desc_create_with_tag(
             &expect_out_md, 2, out_dims, data_type, out_tag);

     dnnl_memory_desc_permute_axes(&out_md, in_md, permutation);
     assert(dnnl_memory_desc_equal(out_md, expect_out_md));

     dnnl_memory_desc_destroy(in_md);
     dnnl_memory_desc_destroy(out_md);
     dnnl_memory_desc_destroy(expect_out_md);
```

# Arguments
* `out_memory_desc`: Output memory descriptor.
* `in_memory_desc`: An existing memory descriptor. Must have format\\_kind set to #dnnl\\_blocked or #dnnl\\_format\\_kind\\_any.
* `permutation`: Axes permutation (of size `in\\_memory\\_desc->ndims`).
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_memory_desc_permute_axes(out_memory_desc, in_memory_desc, permutation)
    @ccall libdnnl.dnnl_memory_desc_permute_axes(out_memory_desc::Ptr{dnnl_memory_desc_t}, in_memory_desc::const_dnnl_memory_desc_t, permutation::Ptr{Cint})::dnnl_status_t
end

"""
    dnnl_memory_desc_query(memory_desc, what, result)

Queries a memory descriptor for various pieces of information.

The following information can be queried: - Number of dimensions (#dnnl\\_query\\_ndims\\_s32) - Dimensions (#dnnl\\_query\\_dims) in the following order: - CNN data tensors: mini-batch, channel, spatial (<code>{N, C, [[D,] H,] W}</code>) - CNN weight tensors: group (optional), output channel, input channel, spatial (<code>{[G,] O, I, [[D,] H,] W}</code>) - RNN data tensors: time, mini-batch, channels (<code>{T, N, C}</code>) or layers, directions, states, mini-batch, channels (<code>{L, D, S, N, C}</code>) - RNN weight tensor: layers, directions, input channel, gates, output channels (<code>{L, D, I, G, O}</code>) - Data type of the tensor elements (#dnnl\\_query\\_data\\_type) - Padded dimensions (#dnnl\\_query\\_padded\\_dims) - size of the data including padding in each dimension - Padded offsets (#dnnl\\_query\\_padded\\_offsets) - per-dimension offset from the padding to actual data, the top-level tensor with offsets applied must lie within the padding area. - Submemory offset (#dnnl\\_query\\_submemory\\_offset\\_s64) - offset from memory origin to the current block, non-zero only in a description of a memory sub-block. - Format kind (#dnnl\\_query\\_format\\_kind) - memory format kind

!!! note

    The order of dimensions does not depend on the memory format, so whether the data is laid out in #dnnl\\_nchw or #dnnl\\_nhwc the dims for 4D CN data tensor would be <code>{N, C, H, W}</code>.

The following queries are applicable only to format kind #dnnl\\_blocked. - Strides (#dnnl\\_query\\_strides) between the outermost blocks or in case of plain (non-blocked) formats the strides between dimensions - Number of innermost blocks (#dnnl\\_query\\_inner\\_nblks\\_s32), e.g. `{4, 16, 4}` in case of `OIhw_4i16o4i` - Size of the innermost blocks (#dnnl\\_query\\_inner\\_blks), e.g. 3 in case of `OIhw_4i16o4i_` - Logical indices of the blocks (#dnnl\\_query\\_inner\\_idxs), e.g. `{1, 0, 1}` in case of `4i16o4i`, because `i` is the 1st dim and `o` is the 0st dim

# Arguments
* `memory_desc`: Memory descriptor.
* `what`: Parameter to query.
* `result`: Output result. The type depends on the query. For example, it must be a [`dnnl_dims_t`](@ref)** if querying for a strides.
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_memory_desc_query(memory_desc, what, result)
    @ccall libdnnl.dnnl_memory_desc_query(memory_desc::const_dnnl_memory_desc_t, what::dnnl_query_t, result::Ptr{Cvoid})::dnnl_status_t
end

