"""
    dnnl_memory_create(memory, memory_desc, engine, handle)

Creates a memory object.

Unless `handle` is equal to [`DNNL_MEMORY_NONE`](@ref), the constructed memory object will have the underlying buffer set. In this case, the buffer will be initialized as if [`dnnl_memory_set_data_handle`](@ref)() had been called.

