"""
    dnnl_convolution_forward_primitive_desc_create(primitive_desc, engine, prop_kind, alg_kind, src_desc, weights_desc, bias_desc, dst_desc, strides, dilates, padding_l, padding_r, attr)

Creates a primitive descriptor for a convolution forward propagation primitive.

!!! note

    Memory descriptors can be initialized with #dnnl\\_format\\_tag\\_any or with format\\_kind set to #dnnl\\_format\\_kind\\_any.

Arrays `strides`, `dilates`, `padding_l`, and `padding_r` contain values for spatial dimensions only and hence must have the same number of elements as there are spatial dimensions. The order of values is the same as in the tensor: depth (for 3D tensors), height (for 3D and 2D tensors), and width.

# Arguments
* `primitive_desc`: Output primitive descriptor.
* `engine`: Engine to use.
* `prop_kind`: Propagation kind. Possible values are #dnnl\\_forward\\_training and #dnnl\\_forward\\_inference.
* `alg_kind`: Convolution algorithm. Possible values are #dnnl\\_convolution\\_direct, #dnnl\\_convolution\\_winograd, #dnnl\\_convolution\\_auto.
* `src_desc`: Source memory descriptor.
* `weights_desc`: Weights memory descriptor.
* `bias_desc`: Bias memory descriptor. Passing NULL, a zero memory descriptor, or a memory descriptor with format\\_kind set to #dnnl\\_format\\_kind\\_undef disables the bias term.
* `dst_desc`: Destination memory descriptor.
* `strides`: Array of strides for spatial dimension.
* `dilates`: Array of dilations for spatial dimension. A zero value means no dilation in the corresponding dimension.
* `padding_l`: Array of padding values for low indices for each spatial dimension `([[front,] top,] left)`.
* `padding_r`: Array of padding values for high indices for each spatial dimension `([[back,] bottom,] right)`. Can be NULL in which case padding is considered to be symmetrical.
* `attr`: Primitive attributes (can be NULL).
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_convolution_forward_primitive_desc_create(primitive_desc, engine, prop_kind, alg_kind, src_desc, weights_desc, bias_desc, dst_desc, strides, dilates, padding_l, padding_r, attr)
