"""
    dnnl_pooling_forward_primitive_desc_create(primitive_desc, engine, prop_kind, alg_kind, src_desc, dst_desc, strides, kernel, dilation, padding_l, padding_r, attr)

Creates a primitive descriptor for a pooling forward propagation primitive.

Arrays `strides`, `kernel`, `dilation`, `padding_l` and `padding_r` contain values for spatial dimensions only and hence must have the same number of elements as there are spatial dimensions. The order of values is the same as in the tensor: depth (for 3D tensors), height (for 3D and 2D tensors), and width.

# Arguments
* `primitive_desc`: Output primitive descriptor.
* `engine`: Engine to use.
* `prop_kind`: Propagation kind. Possible values are #dnnl\\_forward\\_training and #dnnl\\_forward\\_inference.
* `alg_kind`: Pooling algorithm kind: either #dnnl\\_pooling\\_max, #dnnl\\_pooling\\_avg\\_include\\_padding, or #dnnl\\_pooling\\_avg\\_exclude\\_padding.
* `src_desc`: Source memory descriptor.
* `dst_desc`: Destination memory descriptor.
* `strides`: Array of strides for spatial dimension.
* `kernel`: Array of kernel spatial dimensions.
* `dilation`: Array of dilations for spatial dimension.
* `padding_l`: Array of padding values for low indices for each spatial dimension `([[front,] top,] left)`.
* `padding_r`: Array of padding values for high indices for each spatial dimension `([[back,] bottom,] right)`. Can be NULL in which case padding is considered to be symmetrical.
* `attr`: Primitive attributes (can be NULL).
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_pooling_forward_primitive_desc_create(primitive_desc, engine, prop_kind, alg_kind, src_desc, dst_desc, strides, kernel, dilation, padding_l, padding_r, attr)
    @ccall libdnnl.dnnl_pooling_forward_primitive_desc_create(primitive_desc::Ptr{dnnl_primitive_desc_t}, engine::dnnl_engine_t, prop_kind::dnnl_prop_kind_t, alg_kind::dnnl_alg_kind_t, src_desc::const_dnnl_memory_desc_t, dst_desc::const_dnnl_memory_desc_t, strides::Ptr{Clong}, kernel::Ptr{Clong}, dilation::Ptr{Clong}, padding_l::Ptr{Clong}, padding_r::Ptr{Clong}, attr::const_dnnl_primitive_attr_t)::dnnl_status_t
end

