Creates a primitive descriptor for vanilla RNN forward propagation primitive.

The following arguments may either be `NULL` or point to a zero memory descriptor: - `src_iter_desc`, - `bias_desc`, - `dst_iter_desc`.

This would then indicate that the RNN forward propagation primitive should not use them and should default to zero values instead.

!!! note

    All memory descriptors can be initialized with #dnnl\\_format\\_tag\\_any or with format\\_kind set to #dnnl\\_format\\_kind\\_any.

# Arguments
* `primitive_desc`: Output primitive descriptor.
* `engine`: Engine to use.
* `prop_kind`: Propagation kind. Possible values are #dnnl\\_forward\\_training and #dnnl\\_forward\\_inference.
* `activation`: Activation kind. Possible values are #dnnl\\_eltwise\\_relu, #dnnl\\_eltwise\\_tanh or #dnnl\\_eltwise\\_logistic.
* `direction`: RNN direction. See dnnl_rnn_direction_t for more info.
* `src_layer_desc`: Memory descriptor for the input vector.
* `src_iter_desc`: Memory descriptor for the input recurrent hidden state vector.
* `weights_layer_desc`: Memory descriptor for the weights applied to the layer input.
* `weights_iter_desc`: Memory descriptor for the weights applied to the recurrent input.
* `bias_desc`: Bias memory descriptor.
* `dst_layer_desc`: Memory descriptor for the output vector.
* `dst_iter_desc`: Memory descriptor for the output recurrent hidden state vector.
* `flags`: Unused.
* `alpha`: Negative slope if activation is #dnnl\\_eltwise\\_relu.
* `beta`: Unused.
* `attr`: Primitive attributes (can be NULL).
# Returns
#dnnl\\_success on success and a status describing the error otherwise.
"""
function dnnl_vanilla_rnn_forward_primitive_desc_create(primitive_desc, engine, prop_kind, activation, direction, src_layer_desc, src_iter_desc, weights_layer_desc, weights_iter_desc, bias_desc, dst_layer_desc, dst_iter_desc, flags, alpha, beta, attr)
