"""
    dnnl_set_jit_profiling_flags(flags)

Sets library profiling flags. The flags define which profilers are supported.

!!! note

    This setting overrides DNNL\\_JIT\\_PROFILE environment variable.

Passing DNNL_JIT_PROFILE_NONE disables profiling completely.

# Arguments
* `flags`: Profiling flags that can contain the following bits: - DNNL_JIT_PROFILE_VTUNE -- integration with VTune Profiler (on by default) - DNNL_JIT_PROFILE_LINUX_JITDUMP -- produce Linux-specific jit-pid.dump output (off by default). The location of the output is controlled via JITDUMPDIR environment variable or via [`dnnl_set_jit_profiling_jitdumpdir`](@ref)() function. - DNNL_JIT_PROFILE_LINUX_PERFMAP -- produce Linux-specific perf-pid.map output (off by default). The output is always placed into /tmp.
# Returns
#dnnl\\_invalid\\_arguments/#dnnl::status::invalid\\_arguments if the `flags` value is invalid, and #dnnl\\_success/#dnnl::status::success on success.
# See also
dev_guide_profilers
"""
function dnnl_set_jit_profiling_flags(flags)
    @ccall libdnnl.dnnl_set_jit_profiling_flags(flags::Cuint)::dnnl_status_t
end

"""
    dnnl_set_jit_profiling_jitdumpdir(dir)

Sets JIT dump output path. Only applicable to Linux and is only used when profiling flags have [`DNNL_JIT_PROFILE_LINUX_PERF`](@ref) bit set.

After the first JIT kernel is generated, the jitdump output will be placed into temporary directory created using the mkdtemp template 'dir/.debug/jit/dnnl.XXXXXX'.

!!! note

    This setting overrides JITDUMPDIR environment variable. If JITDUMPDIR is not set, and this function is never called, the path defaults to HOME. Passing NULL reverts the value to default.

!!! note

    The directory is accessed only when the first JIT kernel is being created. JIT profiling will be disabled in case of any errors accessing or creating this directory.

# Arguments
* `dir`: JIT dump output path.
# Returns
#dnnl\\_unimplemented/#dnnl::status::unimplemented on Windows.
# See also
dev_guide_profilers
"""
function dnnl_set_jit_profiling_jitdumpdir(dir)
    @ccall libdnnl.dnnl_set_jit_profiling_jitdumpdir(dir::Cstring)::dnnl_status_t
end

"""
    dnnl_set_max_cpu_isa(isa)

Sets the maximal ISA the library can dispatch to on the CPU. See #[`dnnl_cpu_isa_t`](@ref) and #dnnl::cpu\\_isa for the list of the values accepted by the C and C++ API functions respectively.

This function has effect only once, and returns an error on subsequent calls. It should also be invoked before any other oneDNN API call, otherwise it may return an error.

This function overrides the DNNL\\_MAX\\_CPU\\_ISA environment variable. The environment variable can be set to the desired maximal ISA name in upper case and with dnnl\\_cpu\\_isa prefix removed. For example: `DNNL\\_MAX\\_CPU\\_ISA=AVX2`.

!!! note

    The ISAs are only partially ordered: - SSE41 < AVX < AVX2 < AVX2\\_VNNI < AVX2\\_VNNI\\_2, - AVX2 < AVX512\\_CORE < AVX512\\_CORE\\_VNNI < AVX512\\_CORE\\_BF16 < AVX10\\_1\\_512 < AVX10\\_1\\_512\\_AMX < AVX10\\_1\\_512\\_AMX\\_FP16, - AVX2\\_VNNI < AVX10\\_1\\_512. Aliases: - AVX512\\_CORE\\_FP16 = AVX10\\_1\\_512 - AVX512\\_CORE\\_AMX = AVX10\\_1\\_512\\_AMX - AVX512\\_CORE\\_AMX\\_FP16 = AVX10\\_1\\_512\\_AMX\\_FP16

# Arguments
* `isa`: Maximal ISA the library should dispatch to. Pass #dnnl\\_cpu\\_isa\\_default/#dnnl::cpu\\_isa::isa\\_default to remove ISA restrictions (except for ISAs with initial support in the library).
# Returns
#dnnl\\_unimplemented/#dnnl::status::unimplemented if the feature was disabled at build time (see dev_guide_build_options for more details).
# See also
dev_guide_cpu_dispatcher_control for more details
"""
function dnnl_set_max_cpu_isa(isa)
    @ccall libdnnl.dnnl_set_max_cpu_isa(isa::dnnl_cpu_isa_t)::dnnl_status_t
end

