"""
    dnnl_sgemm(transa, transb, M, N, K, alpha, A, lda, B, ldb, beta, C, ldc)

Performs single-precision matrix-matrix multiply.

The operation is defined as:

`C := alpha * op( A ) * op( B ) + beta * C`

where - `op( X ) = X` or `op( X ) = X**T`, - `alpha` and `beta` are scalars, and - `A`, `B`, and `C` are matrices: - `op( A )` is an `MxK` matrix, - `op( B )` is an `KxN` matrix, - `C` is an `MxN` matrix.

The matrices are assumed to be stored in row-major order (the elements in each of the matrix rows are contiguous in memory).

!!! note

    This API does not support XERBLA. Instead, unlike the standard BLAS functions, this one returns a [`dnnl_status_t`](@ref) value to allow error handling.

# Arguments
* `transa`: Transposition flag for matrix A: 'N' or 'n' means A is not transposed, and 'T' or 't' means that A is transposed.
* `transb`: Transposition flag for matrix B: 'N' or 'n' means B is not transposed, and 'T' or 't' means that B is transposed.
* `M`: The M dimension.
* `N`: The N dimension.
* `K`: The K dimension.
* `alpha`: The alpha parameter that is used to scale the product of matrices A and B.
* `A`: A pointer to the A matrix data.
* `lda`: The leading dimension for the matrix A.
* `B`: A pointer to the B matrix data.
* `ldb`: The leading dimension for the matrix B.
* `beta`: The beta parameter that is used to scale the matrix C.
* `C`: A pointer to the C matrix data.
* `ldc`: The leading dimension for the matrix C.
# Returns
#dnnl\\_success/#dnnl::status::success on success and a status describing the error otherwise.
"""
function dnnl_sgemm(transa, transb, M, N, K, alpha, A, lda, B, ldb, beta, C, ldc)
    @ccall libdnnl.dnnl_sgemm(transa::Cchar, transb::Cchar, M::dnnl_dim_t, N::dnnl_dim_t, K::dnnl_dim_t, alpha::Cfloat, A::Ptr{Cfloat}, lda::dnnl_dim_t, B::Ptr{Cfloat}, ldb::dnnl_dim_t, beta::Cfloat, C::Ptr{Cfloat}, ldc::dnnl_dim_t)::dnnl_status_t
end

"""
    dnnl_gemm_u8s8s32(transa, transb, offsetc, M, N, K, alpha, A, lda, ao, B, ldb, bo, beta, C, ldc, co)

Performs integer matrix-matrix multiply on 8-bit unsigned matrix A, 8-bit signed matrix B, and 32-bit signed resulting matrix C.

The operation is defined as:

`C := alpha * (op(A) - A\\_offset) * (op(B) - B\\_offset) + beta * C + C\\_offset`

where - `op( X ) = X` or `op( X ) = X**T`, - `alpha` and `beta` are scalars, and - `A`, `B`, and `C` are matrices: - `op( A )` is an `MxK` matrix, - `op( B )` is an `KxN` matrix, - `C` is an `MxN` matrix. - `A_offset` is an `MxK` matrix with every element equal the `ao` value, - `B_offset` is an `KxN` matrix with every element equal the `bo` value, - `C_offset` is an `MxN` matrix which is defined by the `co` array of size `len`: - if `offsetc = F`: the `len` must be at least `1`, - if `offsetc = C`: the `len` must be at least `max(1, m)`, - if `offsetc = R`: the `len` must be at least `max(1, n)`,

The matrices are assumed to be stored in row-major order (the elements in each of the matrix rows are contiguous in memory).

!!! note

    This API does not support XERBLA. Instead, unlike the standard BLAS functions, this one returns a [`dnnl_status_t`](@ref) value to allow error handling.

!!! warning

    On some architectures saturation may happen during intermediate computations, which would lead to unexpected results. For more details, refer to dev_guide_int8_computations.

# Arguments
* `transa`: Transposition flag for matrix A: 'N' or 'n' means A is not transposed, and 'T' or 't' means that A is transposed.
* `transb`: Transposition flag for matrix B: 'N' or 'n' means B is not transposed, and 'T' or 't' means that B is transposed.
* `offsetc`: Flag specifying how offsets should be applied to matrix C: - 'F' means that the same offset will be applied to each element of the matrix C, - 'C' means that individual offset will be applied to each element within each column, - 'R' means that individual offset will be applied to each element within each row.
* `M`: The M dimension.
* `N`: The N dimension.
* `K`: The K dimension.
* `alpha`: The alpha parameter that is used to scale the product of matrices A and B.
* `A`: A pointer to the A matrix data.
* `lda`: The leading dimension for the matrix A.
* `ao`: The offset value for the matrix A.
* `B`: A pointer to the B matrix data.
* `ldb`: The leading dimension for the matrix B.
* `bo`: The offset value for the matrix B.
* `beta`: The beta parameter that is used to scale the matrix C.
* `C`: A pointer to the C matrix data.
* `ldc`: The leading dimension for the matrix C.
* `co`: An array of offset values for the matrix C. The number of elements in the array depends on the value of `offsetc`.
# Returns
#dnnl\\_success/#dnnl::status::success on success and a status describing the error otherwise.
"""
function dnnl_gemm_u8s8s32(transa, transb, offsetc, M, N, K, alpha, A, lda, ao, B, ldb, bo, beta, C, ldc, co)
    @ccall libdnnl.dnnl_gemm_u8s8s32(transa::Cchar, transb::Cchar, offsetc::Cchar, M::dnnl_dim_t, N::dnnl_dim_t, K::dnnl_dim_t, alpha::Cfloat, A::Ptr{UInt8}, lda::dnnl_dim_t, ao::UInt8, B::Ptr{Int8}, ldb::dnnl_dim_t, bo::Int8, beta::Cfloat, C::Ptr{Int32}, ldc::dnnl_dim_t, co::Ptr{Int32})::dnnl_status_t
end

